export default function MyComments({ userInfo }) {

  return (
    <>
    <div style={{display:'flex'}}>
      <RateReviewIcon style={{marginLeft:'15px', marginTop:'2px'}}/><Title>코멘트</Title>
    </div>
    </>
  );
}
